import { Box } from "@mui/material";
import sizeConfigs from "../../../configs/sizeConfigs";
import Sidebar from "../Sidebar";
import Topbar from "../Topbar";

const MainLayout = () => {
    return (
        <Box sx={{ display: "flex" }}>
            <Topbar/>
            <Box
            component="nav"
            sx={{
                width: sizeConfigs.sidebar.width,
                flexShrink: 0
            }}>
                <Sidebar />
            </Box>
        </Box>
    );
};

export default MainLayout;
